import React from 'react';
import "./Portfolio.css";
const Card = ({picture}) => {
    return (
            <div className="card">
                <picture>
                    <img src={picture} alt="card1" />
                </picture>
                <div className="layer">
                    <i onClick={this.props.openModal} className="text-white fa-solid fa-plus fa-6x"></i>
                </div>
            </div>
    );
};

export default Card;
